    switch (ch) {
      case '(': return BlockKind.PAREN;
      case '[': return BlockKind.BRACKET;
      case '{': return BlockKind.BRACE;
      case '<': return BlockKind.ANGLE;
      case '|': return BlockKind.PIPE;
      default: return null;
    }
